objetoCompra:
Serviço de Instalação de Foco Cirúrgico no Bloco Cirúrgico do Hospital de Guarnição de Alegrete nas seguintes condições:
- Remoção do foco cirúrgico existente;
- Instalação e teste do novo foco cirúrgico;
O interessado em realizar o serviço deverá comparecer ao Hospital de Guarnição de Alegrete para reconhecer o local do trabalho, bem como verificar o novo material a ser instalado e no valor da sua proposta já deverá estar incluídos os materiais necessários para instalação que por ventura não sejam disponibilizados pelo fornecedor do material, tipo, parafusos, buchas, braçadeiras, que deverão ser fornecidos pelo contratado.

informacaoComplementar:
Cada kit deverá conter um exemplar de cada módulo, totalizando 14 volumes por estudante. Requisitos mínimos obrigatórios do material:
Cada caderno/módulo deverá estar finalizado, impresso e pronto para uso pedagógico, caracterizando produto editorial acabado;
O conteúdo deverá estar alinhado à Base Nacional Comum Curricular (BNCC) e ao Referencial Curricular do Ensino Médio do Estado de Rondônia (RCRO-EM);
Todos os módulos deverão possuir registro junto à Câmara Brasileira do Livro (CBL) e número de ISBN (International Standard Book Number), válidos e atualizados no momento da entrega;
Os materiais deverão ser entregues em sua forma original, sem necessidade de personalização gráfica, impressão sob demanda ou serviços adicionais de editoração.
